const configList=document.getElementById("configList");getSharedConfigs();function onSharedConfigsLoaded(b){configList.innerHTML="";if(b.length==0){configList.innerHTML+='<span class="list-item"><i class="config list-icon"></i>No Shared Configs found</span>'}else{for(var a=0;a<b.length;a++){configList.innerHTML+='<span class="list-item"><i class="config list-icon"></i>'+b[a].configName+'<button class="edit" onclick="location.href=\'/pages/config.php?id='+b[a]._id+'\'" type="button">Edit</button><button class="delete" onclick="deleteSharedConfig(\''+b[a]._id+'\')" type="button">Delete</button></span>'}}};